import React from 'react';

export default function Column({ column }) {
  return (
    <div style={{
      margin: `8px`,
      border: `1px solid lightgrey`,
      borderRadius: `2px`
    }}>
      <h3 style={{
        padding: `8px`
      }}>
        {column.title}
      </h3>
      <div>
        {"Tasks go here."}
      </div>
    </div>
  );
}
